import React from 'react';
import CSharp from '../assets/c#.png'

function Experiences() {
  return (
    <div name='technologies' className='w-full h-screen text-gray-300 bg-[#0D0C4B]'>
        {/* Container */}
        <div className='w-full h-screen'>
            <p className='text-4xl py-2 font-bold inline border-b-4 border-amber-700'>Technologies</p>
            <p className='py-4'>These are the technologies I have worked with,</p>
        </div>

        <div>
            <div>
                <img className='w-15' src={CSharp} alt="C#"/><text>C#</text>
            </div>
        </div>
    </div>
  )
}

export default Experiences
